import React from "react";
import "./Footer.css";
// import instagram_icon from "../Asset/instagram_icon.png";
// import pinterest_icon from "../Asset/pintester_icon.png";
// import whatsapp_icon from "../Asset/whatsapp_icon.png";

const Footer = () => {
  const [menu, setMenu] = useState("shop");
  return (
    // <div className="footer">
    //   <div className="footer-logo">
    //     <img src={footer_logo} alt="" />
    //     <p>iClock</p>
    //   </div>
    //   <ul className="footer-links">
    //     <li>Về chúng tôi</li>
    //     <li>Sản phẩm của chúng tôi</li>
    //     <li>Trụ sở</li>
    //     <li>Chính sách đổi trả và bảo hành</li>
    //     <li>Liên hệ</li>
    //   </ul>
    //   <div className="footer-social-icon">
    //     <div className="footer-icons-container">
    //       <img src={instagram_icon} alt="" />
    //     </div>
    //     <div className="footer-icons-container">
    //       <img src={pinterest_icon} alt="" />
    //     </div>
    //     <div className="footer-icons-container">
    //       <img src={whatsapp_icon} alt="" />
    //     </div>
    //   </div>
    //   <div className="footer-copyright">
    //     <hr />
    //     <p>Copyright @ 2024 - Mọi quyền được bảo lưu</p>
    //   </div>
    // </div>
    <div className="footer-new">
      <div className="infomation-footer">
        <p>iClock</p>
        <span>Nơi thời trang được lên ngôi</span>
        <div className="phone-info">
          <i class="fa-solid fa-phone"></i>
          <span>0123456789</span>
        </div>
        <div className="social-info">
          <i class="fa-solid fa-earth-americas"></i>
          <span>www.iclock.vn</span>
        </div>
        <div className="mail-info">
          <i class="fa-solid fa-envelope"></i>
          <span>iclockhotro@gmail.com</span>
        </div>
        <div className="address-info">
          <i class="fa-solid fa-location-dot"></i>
          <span>
            Khu 2, đường 3 tháng 2, phường Xuân Khánh, quận Ninh Kiều, Cần Thơ
          </span>
        </div>
      </div>
      <div className="footer-link">
        <div className="social-media">
          <div className="link">
            <span>Hỗ trợ</span>
            <ul>
              <li>
                <a href="">Bảo mật thông tin</a>
              </li>
              <li>
                <a href="">Bảo hành và đổi trả</a>
              </li>
              <li>
                <a href="">Điều khoản sử dụng</a>
              </li>
              <li>
                <a href="">Chính sách hoàn tiền</a>
              </li>
              <li>
                <a href="">Chính sách vận chuyển</a>
              </li>
              <li>
                <a href="">Liên hệ</a>
              </li>
            </ul>
          </div>
        </div>
        <div className="social-media">
          <div className="link">
            <span>Menu chính</span>
            <ul>
              <li>
                <a href="">Trang chủ</a>
                <li
                  onClick={() => {
                    setMenu("mens");
                  }}
                ></li>
              </li>
              <li>
                <a href="">Ưu đãi</a>
              </li>
              <li>
                <a href="">Bộ sưu tập</a>
              </li>
            </ul>
          </div>
        </div>
        <div className="social-media">
          <div className="link">
            <span>Sản phẩm</span>
            <ul>
              <li>
                <a href="/mens">Phái Mạnh</a>
              </li>
              <li>
                <a href="/womens">Phái Đẹp</a>
              </li>
              <li>
                <a href="/kids">Trẻ Em</a>
              </li>
            </ul>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Footer;
